description:
Verenigde Staten
Actie / Sciencefiction
154 minuten

een zeer goeie film

met Shia LaBeouf, Rosie Huntington-Whiteley en Patrick Dempsey

Nadat Sam Witwicky is afgestudeerd, lukt het hem niet om werk te vinden en dat zet de relatie met zijn vriendin Carly onder 
druk. Sam ontdekt dat de NASA tijdens de eerste maanlanding in 1961 een gestrand ruimteschip heeft aangetroffen afkomstig van 
de planeet Cybertron, waar de moedige Autobots een bittere strijd voerden tegen de boosaardige Decepticons. Wanneer Optimus 
Prime, de leider van de Autobots, hoort van het ruimteschip op de maan, plant hij een missie om de waardevolle Zuilen aan 
boord veilig te stellen. Sam ontdekt echter dat de Decepticons hem voor zijn geweest en met de Zuilen een ruimtebrug maken die 
een heel leger naar de aarde brengt. Kunnen Sam en de Autobots voorkomen dat de Decepticons de mensen tot hun slaven maken?
